import React from "react";
import "./style.css";

function NavBar(props) {
  return (
      <nav class="navbar fixed-top navbar-light bg-light">
        <div className="container">
            <p>
            {props.title}
            </p>

        </div>

    </nav>
  )

}

export default NavBar;
